import React from "react";

const ContactCard = (props) => {
    const { id, name, email} = props.ContactCard;

    return (
        <div className="item">
            <div className="content">
                <div className="header">{name}</div>
                <div>{email}</div>
            </div>
            <i
            className="trash alternate outline icon"
            style={{color}}
            ></i>
        </div>
    )
}
